          reverse: false
        }
      }
    }
  },
  mounted() {
    this.load();
    this.animateWebDeveloper();
  },
  methods: {
    load() {
      anime({
        targets: "#title path",
        strokeDashoffset: [anime.setDashoffset, 0],
        translateX: [50, 0],
        easing: "easeInOutSine",
        duration: 1500,
        direction: "alternate",
        loop: false
      });
    },
    animateWebDeveloper() {
      anime({
        targets: ".alternate",
        translateX: [50, 0],
        opacity: [0, 1],
        easing: "easeOutExpo",
        duration: 2000,
        delay: 500
      });
    }
  }
}
</script>

